nd family, they are distinct people with very different personalities, needs, tastes and desires. But to the outside world they are a medical mystery -- particularly given the fact that they can do virtually all the same things as their friends, including playing the piano, riding a bike, swimming and playing softball \"Their personalities make them inspirational,\" says their mother Patty. \"They never give up; anything they want to do, they go out and do it.\"\r\n\r\nThe medical world is keen to find out how two separate brains and nervous systems can work in such a perfectly co-ordinated way, but the twins and their family have always resisted non-essential medical tests. \"The family want to treat them as though they are just like everyone else,\" says Joy Westerdahl, the girls' doctor, who admits that it is a mystery how their unique physiology functions.\r\n\r\nAs they enter adulthood, the twins are likely to leave the haven of their home town and face the wider world. In preparation for that time, they have taken part in this intimate documentary to show the world what it is like to be joined for life.\r\n\r\n"},{"text":"http://en.wikipedia.org/wiki/Abigail_...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIkvvU3vuS6gIVDQXgCh2FZgY6SPqyjfqNjrLPKw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=K57IcN9DWXo\u0026redir_token=zG0OFwDByb6VfSogyzHdwm3UxlJ8MTU5MjgzMDkyOEAxNTkyNzQ0NTI4\u0026event=video_description\u0026q=http%3A%2F%2Fen.wikipedia.org%2Fwiki%2FAbigail_and_Brittany_Hensel","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=K57IcN9DWXo\u0026redir_token=zG0OFwDByb6VfSogyzHdwm3UxlJ8MTU5MjgzMDkyOEAxNTkyNzQ0NTI4\u0026event=video_description\u0026q=http%3A%2F%2Fen.wikipedia.org%2Fwiki%2FAbigail_and_Brittany_Hensel","target":"TARGET_NEW_WINDOW","nofollow":true}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Subscribe"},"navigationEndpoint":{"click  their friends and family, they are distinct people with very different personalities, needs, tastes and desires. But to the outside world they are a medical mystery -- particularly given the fact that they can do virtually all the same things as their friends, including playing the piano, riding a bike, swimming and playing softball \"Their personalities make them inspirational,\" says their mother Patty. \"They never give up; anything they want to do, they go out and do it.\"\r\n\r\nThe medical world is keen to find out how two separate brains and nervous systems can work in such a perfectly co-ordinated way, but the twins and their family have always resisted non-essential medical tests. \"The family want to treat them as though they are just like everyone else,\" says Joy Westerdahl, the girls' doctor, who admits that it is a mystery how their unique physiology functions.\r\n\r\nAs they enter adulthood, the twins are likely to leave the haven of their home town and face the wider world. In preparation for that time, they have taken part in this intimate documentary to show the world what it is like to be joined for life.\r\n\r\nhttp://en.wikipedia.org/wiki/Abigail_and_Brittany_Hensel","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/K57IcN9DWXo/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAmD2ycwGiAyi765Vt2U8peYXUESg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/K57IcN9DWXo/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC2FMaxcwVe_MTmTFSRgT4SxwYPtg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/K57IcN9DWXo/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAIEGTFuRhIBV99tx8PQtUba7AQTQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/K57IcN9DWXo/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDRnPptAvlJ9UPp54j2z0paxuos7Q","width":336,"height":
